import streamlit as st
import time

st.title("IMAGES")

# create a streamlit variable
if 'count' not in st.session_state:
    st.session_state.count = 0

# you can add a spinner if you want
if st.session_state.count == 0:
    with st.spinner("FETCHING IMAGES...ðŸ’«"):
        time.sleep(3)
        st.session_state.count += 1

vertical_alignment = st.selectbox("You can also align the widgets",
             ['top', 'center', 'bottom'])

# create the number of columns
# you can also adjust the vertical alignment - top, center, bottom
c1, c2 = st.columns(2, vertical_alignment=vertical_alignment)

with c1:
    #
    st.header("IMAGE 1")
    # copied image path from google
    st.image("data:image/jpeg;base64,",
             caption="THIS IS MY HAPPY FACE",
             use_column_width="always")

with c2:
    st.header("IMAGE 2")
    st.image("data:image/jpeg;base64,",
             caption="THIS IS MY SAD FACE",
             use_column_width="always")